import React from "react";
import "./header.css";
import {Container, Row, Col} from "react-bootstrap";

class Header extends React.Component {
    render() {
        return (
            <Container fluid>
                <Col md="4">
                    <h1 className="headerTitle">
                        DiSSCo Annotation Portal
                    </h1>
                </Col>
            </Container>
        );
    }
}

export default Header;
